        padding: 2px 16px;
      }

        border-collapse: collapse;
        border-spacing: 0;
        width: 100%;
        border: 1px solid gray;
      }

      th,
      td {
        text-align: left;
        padding: 16px;
      }

      tr:nth-child(even) {
        background-color: darkgrey;
      }
    </style>
